import React, { useState } from 'react'

export default function TodoList() {
    const [formData,submittedFormData]=useState({
        time:"",
        note:""
    })
  return (
    <div>
        <h1>TodoList</h1>
        <div id="form">
            <input type="time" type="time" value="formData.time"/>
            <input type="note" type="text" value="formData"/>
        </div>
    </div>
  )
}
